svg.script:
function SVG_doc_loaded(evt) {
    var parentDoc = evt.getTarget().getOwnerDocument();
    var elem = parentDoc.createElement("Ready");
    evt.getTarget().appendChild(elem);
    fetchDataAndUpdate();
}

function fetchDataAndUpdate() {
    var apiUrls = {
        Value1: "https://wtdhistpi/piwebapi/streams/F1DPSy3FGFJlZ0GClg5W7vJPxgyBsAAAV1RESElTVFBJXFdQVFA2MDBMQjYwMDExMQ/value",
        Value3: "https://wtdhistpi/piwebapi/streams/F1DPSy3FGFJlZ0GClg5W7vJPxgcCEAAAV1RESElTVFBJXDNSRC5PVkVSRkxPVw/value"
    };

    for (let key in apiUrls) {
        fetch(apiUrls[key])
            .then(response => response.json())
            .then(data => {
                var value = data.Value;  // Assuming the API returns a JSON object with a 'Value' property
                var textElement = document.getElementById(key + "_pbTextEl");
                if (textElement) {
                    textElement.textContent = value + " FEET";  // Update the text content
                } else {
                    console.log(`Element with ID '${key}_pbTextEl' not found.`);
                }
            })
            .catch(error => console.error("Error fetching data:", error));
    }
}
